	d_fgm b_lower[100] = {-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,-10.0000000000000000,};
	d_fgm beta_var = 0.9451583104443247;
	d_fgm beta_plus = 1.9451583104443246;

	d_fgm Z_new[n_opt_var],Z[n_opt_var];
	d_fgm Y_new[n_opt_var], Y[n_opt_var];
	d_fgm h[n_opt_var];
	d_fgm T[n_opt_var];

